function listShows(props) {
    const showList = props.data.map((props) => {
        return (
            <li>
            Show # {props.id}<br />
            Show Type: {props.showType}<br />
            Theatre: {props.theatre}<br />
            Date Seen: {props.seenOn}<br />
            Rating out of 5 stars: {props.stars}
            </li>
        );
    });
    return <ul>{showList}</ul>;
}
export default listShows;
